// 用于生成商品mock数据的测试函数
const generateItems = (): Item[] => {
	const results: Item[] = [];
	let imageIndex = 0;
	for (let category of categories) {
		for (let i = 0; i < 1000; i++) {
			faker.seed(imageIndex);
			results.push({
				id: category.id * 1000 + i,
				cid: category.id,
				title: faker.commerce.productName().replaceAll(' ', ''),
				cover: `https://picsum.photos/id/${imageIndex % mockImagesSize}/300/200`,
				price: parseInt(faker.commerce.price({ min: 50, max: 100000, dec: 0 }))
			});
			imageIndex++;
		}
	}
	return results;
};

